import React from "react";

export default function Headers() {
  return (
    <ul className="navBar">
      <li>
        <h1>Products</h1>
      </li>
      <li>
        <a href="/">Products</a>
      </li>
      <li>
        <a href="/favourites">Favourites</a>
      </li>
    </ul>
  );
}
